    return (
        <div className={styles.body} id={"about"}>
            <div className={styles.wrapper}>
                <Show>
                    <div className={styles.about}>
                        <div className={styles.text}>

                        </div>
<                       div className={styles.img}>
                            <img src="images/About/about.webp"></img>
                        </div>
                    </div>
                </Show>
            </div>
        </div>
    );
};

export default About;
